import React from "react";
import FileUploadForm from "./components/FileUploadForm";
import FileList from "./components/FileList";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>React File Upload App</h1>
      </header>
      <main>
        <FileUploadForm />
        <FileList />
      </main>
    </div>
  );
}

export default App;
